import React from "react";
import { faTools } from '@fortawesome/free-solid-svg-icons'
import 'materialize-css/dist/css/materialize.min.css'
import "./styles/skills.css";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const skills = () => {
	return (
		<section id="skills" className="section scrollspy">
			<h3 className="page-title white-text teal">Skills</h3>
			<div className="container">
				{/* Front-End */}
				<div className="card">
					<div className="card-content">
						<h4 className="blue-grey-text text-lighten-1">Front-End</h4>
						<div className="row">
							<div className="col s4 m2">
								<img alt="HTML5" src="assets/image/html5.png" className="responsive-img" />
							</div>
							<div className="col s4 m2">
								<img alt="CSS3" src="assets/image/css3.png" className="responsive-img" />
							</div>
							<div className="col s4 m2">
								<img alt="JS" src="assets/image/javascript.png" className="responsive-img" />
							</div>
						</div>
					</div>
				</div>
				{/* Repeat this pattern for other skill categories */}
			</div>
		</section>
	);
};

export default skills;
